Вы действительно хотите перейти на иностранный сервер?

При смене региона действуют следующие ограничения:
	• недоступна некоторая техника;
	• не отображаются эмблемы и надписи;
	• недоступны «Боевые задачи», личные резервы и режим «Учебный бой».

Возможны ошибки и проблемы с качеством соединения. Пожалуйста, уважительно относитесь к игрокам других регионов.
